<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Gym Services</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #f2f2f2;
            margin: 0;
            padding: 0;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between;
        }

        .service {
            background-color: #fff;
            width: 48%;
            margin-bottom: 20px;
            box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
        }

        .service h2 {
            font-size: 24px;
            margin: 10px;
        }

        .service p {
            font-size: 16px;
            margin: 10px;
        }

        .service img {
            max-width: 100%;
            height: auto;
        }
        
        
    </style>
</head>
<body>
    <div class="container">
        <div class="service">
            <h2>Yoga</h2>
            <img src="data:image/jpeg;base64," alt="Yoga">
            <p>Join our yoga classes to improve flexibility, balance, and mental well-being.</p>
        </div>

        <div class="service">
            <h2>Zumba</h2>
            <img src="data:image/jpeg;base64," alt="Zumba">
            <p>Get your heart pumping with our fun and energetic Zumba dance sessions.</p>
        </div>

        <div class="service">
            <h2>Aerobics</h2>
            <img src="data:image/jpeg;base64," alt="Aerobics">
            <p>Burn calories and stay fit with our high-intensity aerobics workouts.</p>
        </div>

        <div class="service">
            <h2>Weightlifting</h2>
            <img src="data:image/jpeg;base64," alt="Weightlifting">
            <p>Build strength and muscle with our weightlifting training programs.</p>
        </div>
    </div>
</body>
</html>